const Card = (data) => {
    return(
        <div className="cards">
            <div className="title">
            <h1>{data.title}</h1>
            </div>
            <div className="date">
                <h1>{data.date}</h1>
            </div>
            <img src={data.image} alt="" />
            
        </div>
    )
}

export default Card;
